Starring: Tommy Gunn, Eva Angelina, Randy Spears, Jenna Haze, Stormy Daniels, Nicole Sheridan, Tory Lane, Voodoo, Steven St. Croix, Marcus London, Ron Jeremy, Kaylani Lei, Austin Kincaid, Melissa Lauren, Roxy Deville, Tony de Sergio, Derrick Pierce, Audrey Bitoni, Veronica Rayne, Lorena Sanchez, Nakita Kash

As one of the largest productions to date, this Wicked Pictures' blockbuster has it all! Action... Romance... Drama... Suspense... and even a little bit of Comedy! Okay, a whole lot of comedy! Join award winning writer/director Stormy Daniels as she leads you on a wild and hilarious adventure. With the head of the CIA (Randy Spears) presumed dead and word of an impending terrorist attack lead by the evil Hussein (Ron Jeremy), the fate of the wolrd rests in the hands of two unlikely and extremely unskilled heroes. Does a secretary (Stormy Daniels) and her wannabe agent husband (Steven St. Croix) have what it takes to put aside their numerous marital issues and travel overseas to put an end to Hussein's quest for total wolrd domination... and his ridiculous get rich quick ideas? With the help of two no-nonsense British agents Jacks and Watson, some embark on a sex-crazed and explosion-filled expedition into hostile territory. Will Operation: Desert Stormy be a success and our &quot;heroes&quot; save the world or will we all be wearing turbans?

